import './HomePage.css';
import { useNavigate } from 'react-router-dom';

const Navbar = () => {

    const navigate = useNavigate();
    const handleLogin = () => {
        navigate("/login");
    };
    const handleSignup = () => {
        navigate("/signup");
    };

    return (
    //    <header className="header">
