    //                 <button onClick={handleLogin}>Login</button>
    //                 <button onClick={handleSignup}>Sign Up</button>
    //             </div>
    //         </header>


    <header className="header">
    <div className="logo">
        <img src="logo1.png" alt="Mood App Logo" />
        <h1>MOODMOON</h1>
    </div>
    <div className="nav-buttons">
    <button onClick={handleLogin}>Login</button>
    //                 <button onClick={handleSignup}>Sign Up</button>
    //            </div>
</header>
    );
};

export default Navbar;
